97b34aa6-386e-11e9-a5d4-28c2dd5a952f	Реверс-инжиниринг для начинающих: основные концепции программирования	Для начинающих	В этой статье мы заглянем под капот программного обеспечения. Новички в реверс-инжиниринге получат общее представление о самом процессе исследования ПО, общих принципах построения программного кода и о том, как читать ассемблерный код.Примечание Программный код для этой статьи компилируется с помощью Microsoft Visual Studio 2015, так что некоторые функции в новых версиях могут использоваться по-другому. В качестве дизассемблера используется IDA Pro.Инициализация переменныхПеременные \nint intvar = 100;\nbool boolvar = false;\nchar charvar = 'B';\ndouble doublevar = 3.1415;\nfloat floatvar = 3.14159265;\nchar carray[] = { 'a', 'b', 'c', 'd', 'e' };Примечание в С++ строка \nprintf(\nprintf(\nprintf(\nprintf(\nprintf(\nprintf(Теперь посмотрим на машинный код. Сначала строковый литерал:Вывод строкового литералаКак видите, строковый литерал сначала помещается в стек для вызова в качестве параметра функции printf().Теперь посмотрим на вывод одной из переменных:Вывод переменнойКак можно заметить, сначала переменная intvar помещается в регистр EAX, который в свою очередь записывается в стек вместе со строковым литералом %i, используемым для обозначения целочисленного вывода. Эти переменные затем берутся из стека и используются в качестве параметров при вызове функции printf().Математические операцииСейчас мы поговорим о следующих математических операциях:Сложение.Вычитание.Умножение.Деление.Поразрядная конъюнкция (И).Поразрядная дизъюнкция (ИЛИ).Поразрядное исключающее ИЛИ.Поразрядное отрицание.Битовый сдвиг вправо.Битовый сдвиг влево.void mathfunctions() { // математические операции\n\n    int A = 10;\n    int B = 15;\n    int add = A + B;\n    int sub = A - B;\n    int mult = A * B;\n    int div = A / B;\n    int and = A \n    int or = A | B;\n    int xor = A ^ B;\n    int not = ~A;\n    int rshift = A \n    int lshift = A \n}Переведём каждую операцию в ассемблерный код:сначала присвоим переменной A значение 0A в шестнадцатеричной системе счисления или 10 в десятичной. Переменной B \nnewfuncret();\nfuncparams(intvar, stringvar, charvar);Сначала посмотрим, как происходит вызов функций newfunc() и newfuncret(), которые вызываются без параметров.Вызов функций без параметровФункция newfunc() просто выводит сообщение :void newfunc() { // новая функция без параметров\n    printf(\n}Функция newfunc()Эта функция использует инструкцию retn, но только для возврата к предыдущему местоположению (чтобы программа могла продолжить свою работу после завершения функции). Посмотрим на функцию newfuncret(), которая генерирует случайное целое число с помощью функции С++ rand() и затем его возвращает.int newfuncret() { // новая функция, которая что-то возвращает\n    int A = rand();\n    \n    return A;\n}Функция newfuncret()Сначала выделяется место под переменную A. Затем вызывается функция rand(), результат которой помещается в регистр EAX. Затем значение EAX помещается в место, выделенное под переменную A, фактически присваивая переменной A результат функции rand(). Наконец, переменная A помещается в регистр EAX, чтобы функция могла его использовать в качестве возвращаемого параметра. Теперь, когда мы разобрались, как происходит вызов функций без параметров и что происходит при возврате значения из функции, поговорим о вызове функции с параметрами.Вызов такой функции выглядит следующим образом:funcparams(intvar, stringvar, charvar);Вызов функции с параметрамиСтроки в С++ требуют вызова функции basic_string, но концепция вызова функции с параметрами не зависит от типа данных. Сначала переменная помещается в регистр, затем оттуда в стек, а потом происходит вызов функции.Посмотрим на код функции:void funcparams (int iparam, string sparam, char cparam) { // функция с параметрами\n\n    printf(\n    printf(\n    printf(\n}Функция funcparams()Эта функция берёт строку, целое число и символ и печатает их с помощью функции printf(). Как видите, сначала переменные размещаются в начале функции, затем они помещаются в стек для вызова в качестве параметров функции printf(). Очень просто.ЦиклыТеперь, когда мы изучили вызов функции, вывод, переменные и математику, перейдём к контролю порядка выполнения кода (flow control). Сначала мы изучим цикл for:void forloop (int max) { // обычный цикл for\n    for (int i = 0; i  ++i){\n        printf(\n    }\n}Графический обзор цикла forПрежде чем разбить ассемблерный код на более мелкие части, посмотрим на общий вариант. Как вы можете видеть, когда цикл for запускается, у него есть 2 варианта:он может перейти к блоку справа (зелёная стрелка) и вернуться в основную программу;он может перейти к блоку слева (красная стрелка) и вернуться к началу цикла for.Цикл for подробноСначала сравниваются переменные i и max, чтобы проверить, достигла ли переменная максимального значения. Если переменная i не больше или не равна переменной max, то подпрограмма пойдёт по красной стрелке (вниз влево) и выведет переменную i, затем i увеличится на 1 и произойдёт возврат к началу цикла. Если переменная i больше или равна max, то подпрограмма пойдёт по зелёной стрелке, то есть выйдет из цикла for и вернётся в основную программу.Теперь давайте взглянем на цикл while:void whileloop() { // цикл while\n\n    int A = 0;\n    while (A10) {\n        A = 0 + (rand()%(int)(20-0+1))\n    }\n    printf(\n}\nЦикл whileВ этом цикле генерируется случайное число от 0 до 20. Если число больше 10, то произойдёт выход из цикла со словами , в противном случае продолжится работа в цикле.В машинном коде переменная А сначала инициализируется и приравнивается к нулю, а затем инициализируется цикл, A сравнивается с шестнадцатеричным числом 0A, которое равно 10 в десятичной системе счисления. Если А не больше и не равно 10, то генерируется новое случайное число, которое записывается в А, и снова происходит сравнение. Если А больше или равно 10, то происходит выход из цикла и возврат в основную программу.Условный операторТеперь поговорим об условных операторах. Для начала посмотрим код:void ifstatement() { // условные операторы\n int A = 0 + (rand()%(int)(20-0+1));\n\n if (A  15) {\n  if (A  10) {\n   if (A  5) {\n    printf(\n   }\n   else {\n    printf(\n   }\n  }\n  else {\n   printf(\n  }\n }\n else {\n  printf(\n }\n}\nЭта функция генерирует случайное число от 0 до 20 и сохраняет получившееся значение в переменной А. Если А больше 15, то программа выведет  (возможными эквивалентностями). Посмотрим код:void switchcase() { // оператор выбора\n int A = 0 + (rand()%(int)(10-0+1));\n\n switch (A) {\n  case 0:\n   printf(\n   break;\n  case 1:\n   printf(\n   break;\n  case 2:\n   printf(\n   break;\n  case 3:\n   printf(\n   break;\n  case 4:\n   printf(\n   break;\n  case 5:\n   printf(\n   break;\n  case 6:\n   printf(\n   break;\n  case 7:\n   printf(\n   break;\n  case 8:\n   printf(\n   break;\n  case 9:\n   printf(\n   break;\n  case 10:\n   printf(\n   break;\n }\n}\nВ этой функции переменная А получает случайное значение от 0 до 10. Затем А сравнивается с несколькими случаями, используя switch. Если значение А равно одному из случаев, то на экране появится соответствующее число, а затем произойдёт выход из оператора выбора и возврат в основную программу.Оператор выбора не следует правилу  и затем перейдёт в секцию возврата.Пользовательский вводВ этом разделе мы рассмотрим ввод пользователя с помощью потока сin из C++. Во-первых, посмотрим на код:void userinput() { // ввод с клавиатуры\n\n    string sentence;\n    cin \n\n    printf(\n\n}В этой функции мы просто записываем строку в переменную sentence с помощью функции C++ cin и затем выводим предложение с помощью оператора printf().Разберём это в машинном коде. Во-первых, функция cin:cin (C++)Сначала происходит инициализация строковой переменной sentence, затем вызов cin и запись введённых данных в sentence.Функция C++ cin детальнееСначала программа устанавливает содержимое переменной sentence в EAX, затем помещает EAX в стек, откуда значение переменной будет использоваться в качестве параметра для потока cin, затем вызывается оператор потока Варвара Николаева Для начинающих	https://tproger.ru/translations/reverse-engineering-basics/	107
