980230f8-386e-11e9-a5d4-28c2dd5a952f	Что может Python сделать за секунду?	Python	Порой можно услышать, что Python медленный в сравнении с определёнными языками. Мы не собираемся разводить дискуссии на тему сравнения языков, а хотим посмотреть на это с другой стороны. Когда-нибудь задумывались, сколько различных операций вы можете совершить в Python всего за 1 секунду? Пройдите наш тест и узнаете!Примечание У всех разное железо, поэтому очевидно, что приведённые здесь результаты могут отличаться от ваших, если вы решите их проверить. Поэтому ваша задача Замеры проводились на современном ноутбуке с быстрым SSD и интернет-подключением.\n\n\n setTimeout(function(){quiz_dont_load.style.display='block';quiz_dont_load.innerHTML='Скоро загрузится, клянусь своей IDE!';},5*1000);setTimeout(function(){quiz_dont_load.style.display='block';quiz_dont_load.innerHTML='Ещё совсем немножко, прям милипусенько...';},10*1000);setTimeout(function(){quiz_dont_load.style.display='block';quiz_dont_load.innerHTML='Викторина загружается дольше, чем обычно: попробуйте потанцевать с бубном — отключить AdBlock и перезагрузить страницу :(';},20*1000); \nНачать тест var quiz_data_stringify="";var quiz_data=JSON.parse(window.atob(quiz_data_stringify));var quiz_template=decodeURIComponent(escape(window.atob('')));var quiz_result_template=decodeURIComponent(escape(window.atob('')));if(quiz_data.code_mode){var head=document.head||document.getElementsByTagName('head')[0];var script=document.createElement('script');script.type='text/javascript';script.defer=true;script.src='https://cdn.tproger.ru/wp-content/themes/bliss/assets/plugins/prism/prism.js?x62709';head.appendChild(script);link=document.createElement('link');link.rel='stylesheet';link.type='text/css';link.href='https://cdn.tproger.ru/wp-content/themes/bliss/assets/plugins/prism/prism.css?x62709';head.appendChild(link);} Никита Прияцелюк, последний центурион Python	https://tproger.ru/quiz/python-fast-and-furious/	107
9820ecf0-386e-11e9-a5d4-28c2dd5a952f	Краткое введение в Bootstrap	Веб-разработка; Для начинающих; Фреймворки; Фронтенд	Bootstrap npm i bootstrap jquery-slim popper.jsТиповая структура проекта выглядит так:.\n├── src\n│   ├── scripts\n│   │   ├── app\n│   │   │   └── .gitkeep\n│   │   ├── vendor\n│   │   │   ├── bootstrap.js\n│   │   │   └── jquery.js\n│   │   ├── app.js\n│   │   └── vendor.js\n│   ├── styles\n│   │   ├── app\n│   │   │   ├── _base.scss\n│   │   │   └── _variables.scss\n│   │   ├── vendor\n│   │   │   └── bootstrap\n│   │   │       ├── _core.scss\n│   │   │       ├── _main.scss\n│   │   │       └── _variables.scss\n│   │   ├── app.scss\n│   │   └── vendor.scss\n│   └── index.html\n├── package.json\n└── webpack.config.jsСтоит пояснить, какие преимущества предоставляет такая структура. Сначала рассмотрим папку styles, а затем перейдём к scripts.StylesЭта папка содержит две вложенные директории\n@import 'app/variables';\n@import 'app/base';Теперь обратите внимание на папку styles/app. Там всего два файла:В файле _base описываются стили. Может расширяться с помощью Normalize.css.В _variables размещаются переменные приложения.В \n@import '~bootstrap/scss/functions'; \n@import '~bootstrap/scss/variables'; \n@import '~bootstrap/scss/mixins'; _main импортирует файл _core.scss вашего проекта в самом верху, а также все необходимые файлы Bootstrap SASS из папки node_modules:@import 'core'; \n@import '~bootstrap/scss/root'; \n@import '~bootstrap/scss/reboot'; \n@import '~bootstrap/scss/type'; \n@import '~bootstrap/scss/images'; \n@import '~bootstrap/scss/code'; \n@import '~bootstrap/scss/grid'; \n@import '~bootstrap/scss/tables'; \n@import '~bootstrap/scss/forms'; \n@import '~bootstrap/scss/buttons'; \n@import '~bootstrap/scss/transitions'; \n@import '~bootstrap/scss/dropdown'; \n@import '~bootstrap/scss/button-group'; \n@import '~bootstrap/scss/input-group'; \n@import '~bootstrap/scss/custom-forms'; \n@import '~bootstrap/scss/nav'; \n@import '~bootstrap/scss/navbar'; \n@import '~bootstrap/scss/card'; \n@import '~bootstrap/scss/breadcrumb'; \n@import '~bootstrap/scss/pagination'; \n@import '~bootstrap/scss/badge'; \n@import '~bootstrap/scss/jumbotron'; \n@import '~bootstrap/scss/alert'; \n@import '~bootstrap/scss/progress'; \n@import '~bootstrap/scss/media'; \n@import '~bootstrap/scss/list-group'; \n@import '~bootstrap/scss/close'; \n@import '~bootstrap/scss/modal'; \n@import '~bootstrap/scss/tooltip'; \n@import '~bootstrap/scss/popover'; \n@import '~bootstrap/scss/carousel'; \n@import '~bootstrap/scss/utilities'; \n@import '~bootstrap/scss/print';\nВ Webpack (автор использует этот сборщик) знак тильды (~) указывает, что файлы нужно искать в папке node_modules. Если вы используете, например, Grunt, то нужно установить grunt-sass-tilde-importer.scripts/vendor.js, который просто импортирует файлы из папки vendor:import './vendor/jquery' \nimport './vendor/bootstrap' Смотрите также: Как отказаться от jQuery в современном фронтендеНеобходимо инициализировать jQuery в объекте window, в противном случае Bootstrap не сможет скомпилироваться. Кроме того, это всё равно придётся сделать,scripts/vendor/jquery.js:import jQuery from 'jquery' \nwindow.$ = window.jQuery = jQueryКак и в файле vendor, придётся импортировать каждый модуль отдельно. Вы также можете закомментировать неиспользуемые компоненты, чтобы исключить их из проекта. Содержимое файлаscripts/vendor/jquery.js:// Core \nimport Util from 'bootstrap/js/src/util' \n\n// Components \nimport Alert from 'bootstrap/js/src/alert' \nimport Button from 'bootstrap/js/src/button'\nimport Carousel from 'bootstrap/js/src/carousel'\nimport Collapse from 'bootstrap/js/src/collapse' \nimport Dropdown from 'bootstrap/js/src/dropdown' \nimport Modal from 'bootstrap/js/src/modal'\nimport Popover from 'bootstrap/js/src/popover' \nimport Scrollspy from 'bootstrap/js/src/scrollspy' \nimport Tab from 'bootstrap/js/src/tab' \nimport Tooltip from 'bootstrap/js/src/tooltip' Следует отметить, что модуль Util используется везде, кроме компонентов Button и Popover.Таким образом, скомпилировав Bootstrap в отдельный файл, можно применять функции и переменные ядра фреймворка в любом месте в проекте. Кроме того, благодаря реализации модульного принципа, ненужные компоненты легко отключить.Примеры использованияSCSSМиксины Bootstrap можно использовать в приложении глобально://styles/app/_base.scss\n:root { \n    font-size: 14px; \n    @include media-breakpoint-up('md.) { \n        font-size: 16px; \n    } \n}Можно использовать дефолтные значения переменных и переопределять их:// styles/app/_variables.scss\n$font-family: 'Roboto Condensed', $font-family-sans-serif; \n// styles/app/_base.scss \nbody {\n    font-family: $font-family; \n} JavaScriptМожно создавать экземпляры любых компонентов Bootstrap в файле scripts/app.js:$(function () { \n    $('#dummy-modal').modal('show') \n}) Чтобы лучше разобраться, вы можете изучить полностью настроенный и функционирующий проект Webpack v4 Configuration, в котором реализована описанная логика. Это хороший пример того, как можно настроить Bootstrap под себя.Также рекомендуем обратить внимание на видеокурс  Best PracticesСергей Штукатуров Веб-разработка, Для начинающих, Фреймворки, Фронтенд	https://tproger.ru/translations/bootstrap-short-intro/	107
9842b01a-386e-11e9-a5d4-28c2dd5a952f	Как понять, что вы уже не junior-разработчик  отвечают эксперты	Для мотивации	Часто молодые специалисты не чувствуют момент, когда уровень их квалификации вырос и можно брать более сложные задачи и просить увеличения зарплаты. По каким признакам это понять? Спрашиваем у экспертов.Краткие выводы в конце статьи.\n\n\n\n\nМихаил Егоров, заместитель генерального директора по стратегическому развитию компании  попасть в компанию, которая поможет вам вырасти за счёт компетентного руководства, интересных проектов и коллег-профессионалов. Важно понимать, что при должном отношении к делу продвижение специалиста искусственно сдерживаться не будет. Если становится очевидно, что человек вырос, его неизбежно повысят.Рынок труда в области разработки ПО достаточно конкурентен, и компании заинтересованы в карьерном развитии сотрудников.2\nОтвет эксперта\n2019-02-10T15:25:16+00:00\n\nРейтинг полезности ответа: 2\nПовысить\nПонизить\n\n\n\nАнтон Пальгунов, Senior Frontend Developer в компании RevolutJunior-разработчик только учится и мало что умеет делать самостоятельно. Middle тоже учится, но уже может решать конкретные задачи, задавая минимум вопросов. Следующий уровень  сходить на собеседование. Это мини-экзамен, после которого можно сильно вырасти в качестве. Разумеется, также можно запросить обратную связь у коллег. Бесплатно и без временных затрат получить объективную оценку знаний и узнать, над чем стоит работать, чтобы выйти на следующий уровень.216\nОтвет эксперта\n2019-02-10T15:25:16+00:00\n\nРейтинг полезности ответа: 216\nПовысить\nПонизить\n\n\n\nЕвгений Ефремов, Software Engineer в MobiDevicesПо моему глубокому убеждению, звания в IT уровню квалификации вовсе не было.Возвращаясь к вопросу: если вы сами справляетесь с задачами, после вас не нужно исправлять баги и вы понимаете требования бизнеса, то вы определено уже не junior. Также можно попросить коллегу по вашей специализации оценить ваш текущий уровень, и уже по результату делать запрос на повышение зарплаты или же подтягивать свои навыки.57\nОтвет эксперта\n2019-02-10T15:25:16+00:00\n\nРейтинг полезности ответа: 57\nПовысить\nПонизить\n\n\n\nДанил Юсупов, инженер-программист 3 категории в компании ICL ServicesПоскольку я сам ещё junior-разработчик, то поделиться опытом мне не придётся. Но, с другой стороны, я считаю, что взгляд снизу не менее важен. Ну, и так как я ещё junior, то обязан знать, что такое middle, и понимать, к чему стремиться.Я считаю, что оценивать уровень программиста по количеству лет, которые он потратил, работая в своей области, неправильно. Как минимум потому, что в IT-мире всё быстро устаревает. Думаю, что тяжело назвать middle’ом того программиста, который 5 лет фиксил баги, и при этом ни разу не реализовал новый функционал.Самостоятельность и уверенность в решении задачЧаще всего текущие задачи, с которыми я сталкиваюсь, заставляют меня  библиотеки так, чтобы не пришлось рефакторить код, то это был бы ещё один поинт в сторону middle-разработчика.Middle-разработчик не станет лепить новый код класс за классом, а скорее всего начнёт с интерфейсов и будет стараться применять паттерны проектирования там, где они уместны. Кстати, вот хороший сайт с каталогом паттернов.Если всё же не ясно:Найдите в компании старшего разработчика, который использует тот же стек, что и вы, и попросите его оценить ваш уровень.Также можете просить коллег проводить ревью вашего кода.Узнайте, над чем ещё вам предстоит работать, чтобы дотянуть до middle.56\nОтвет эксперта\n2019-02-10T15:25:16+00:00\n\nРейтинг полезности ответа: 56\nПовысить\nПонизить\n\n\n\nАлександр Солодченко, предподаватель школы IT и безопасности HackerUОсновные отличия между junior и middle-разработчиком заключаются в уровне самостоятельности при решении задач и качестве их выполнения.При постановке задачи с junior-разработчиком необходимо максимально конкретно обсудить пути решения и используемые технологии. Кроме того, код junior-разработчика нуждается в постоянном ревью более компетентных коллег. И в противоположность этому, middle-разработчики способны самостоятельно брать на себя задачи более высокого уровня.Если вы чувствуете, что всё чаще и чаще вместо того, чтобы полностью проговаривать способ решения задачи, просто берёте и делаете её, а старшие коллеги не вмешиваются в процесс вашей работы, и при дальнейших код-ревью критики вашего кода стало гораздо меньше  можно смело сказать, что вы middle-разработчик.26\nОтвет эксперта\n2019-02-10T15:25:16+00:00\n\nРейтинг полезности ответа: 26\nПовысить\nПонизить\n\n\n\nТимур Нозадзе, руководитель отдела разработки REG.RUКак понять, что ваша мышца уже достаточно выросла, и вы можете жать не 50, а 100 кг? Да не бывает так. Если всегда жали 50, то 100 не выжмете. Сначала надо перейти на 55, 60 кг и т. п. Так же и между junior и middle нет никакого квантового скачка. Это шкала постепенного развития. Поэтому более сложные задачи нужно брать всегда: как только в текущих всё понятно и всё получается  вполне можно ожидать роста компенсаций пропорционально своему вкладу.65\nОтвет эксперта\n2019-02-10T15:25:16+00:00\n\nРейтинг полезности ответа: 65\nПовысить\nПонизить\n\n\n\nРоман Голофаев, ведущий iOS-разработчик  это уровень зрелости, когда много вопросов закрыто. Разработчик почти самостоятельно способен решить задачу, ему не нужно в подробностях объяснять, что и как делать, но без общих объяснений у него редко получается выполнить всё правильно.На уровне Senior есть четкое понимание всех методов и инструментов. Этому разработчику достаточно краткого описания задачи, всё остальное он сможет выполнить самостоятельно. Уровень компетенции такого специалиста позволяет полностью полагаться на его решения без дополнительного контроля, результат работы прогнозируемый и ожидаемый. На этом уровне разработчик способен видеть проект в разрезе, что даёт ему возможность правильно выбирать архитектурные решения.44\nОтвет эксперта\n2019-02-10T15:25:16+00:00\n\nРейтинг полезности ответа: 44\nПовысить\nПонизить\n\n\n\nДмитрий Казаков, руководитель отдела веб-разработки RU-CENTERКак говорил булгаковский Мастер: . Если же юный программист чувствует в себе бурление амбиций, то и говорить надо об этом.В идеальном мире, конечно же, руководитель сам оценит разработчика, без всякого стимула с его стороны, и сам же предложит ему варианты. Понятно, что мы живём не в идеальном мире и менеджмент обычно не совсем идеальный, но и тут лучше спрашивать обратную связь, а не предлагать повысить себе грейд. И делать выводы, разумеется. Если вы подозреваете, что говорите с нормальным человеком, который не будет вас вводить в заблуждение, то надо прислушаться.Ну, а если руководство совсем не блещет и вопросы о квалификации рассматривает как бунт, то лучше поискать себе другое руководство. Если, конечно, чувствуете, что готовы и можете себя продать как специалиста.6\nОтвет эксперта\n2019-02-10T15:25:16+00:00\n\nРейтинг полезности ответа: 6\nПовысить\nПонизить\n\n\n\nКирилл Васин, ведущий инженер-программист компании Bell IntegratorОтличия между junior и middle-разработчиками так или иначе сводятся к их производительности. В разных организациях понятия об уровне разработчиков могут отличаться, но в среднем можно судить по таким признакам.Во-первых, вы уже знаете, как решать типовые несложные задачи в вашем проекте, а также как не допускать типичные ошибки, которые потом могут вылиться в баги и время, затраченное кем-то на их исправление.Во-вторых, вы способны решать более сложные задачи без посторонней помощи. Обычно junior-разработчику для решения любой задачи требуется консультироваться с более опытными коллегами. Разработчик уровня middle большую часть задач способен делать самостоятельно.В-третьих, вы умеете писать читаемый код, понятный другим людям. Junior-разработчики часто об этом не задумываются, стараясь как можно быстрей решить задачу. Если код будет плохо читаемым, то при исправлении ошибок или доработках кому-то придётся тратить лишнее время.Junior  вот тогда вы уже middle-разработчик.19\nОтвет эксперта\n2019-02-10T15:25:16+00:00\n\nРейтинг полезности ответа: 19\nПовысить\nПонизить\n\n\n\nГерман Шеремет, директор по развитию комплекса ГК ) являются данностью. Но понимание причин и приоритетности задачи позволяют правильно выстроить свою работу, предложить оптимальное решение и, в итоге, развиваться в своей профессиональной области.16\nОтвет эксперта\n2019-02-10T15:25:16+00:00\n\nРейтинг полезности ответа: 16\nПовысить\nПонизить\n\n\n\nОлег Граждан, разработчик в VoximplantМожно выделить несколько критериев уровня профессионализма разработчика. Но насколько вы круты по каждому из них, чтобы быть не junior’ом, решать вам.Самостоятельность: другие сотрудники не тратят время на обучение вас технологиям, как внутренним, так и внешним.Качество вашего кода: стоит его оценивать относительно уровня стандартов кодирования в компании.Производительность труда: как с точки зрения скорости решения проблем, так с точки зрения скорости разработки нового функционала. Однако стоит учесть, что скорость разработки может сильно влиять на качество кода, причём не в лучшую сторону.Вклад в кодовую базу продукта: насколько сложные и важные задачи решает ваш код.10\nОтвет эксперта\n2019-02-10T15:25:16+00:00\n\nРейтинг полезности ответа: 10\nПовысить\nПонизить\n\n\n\nВиталий Чижков, руководитель группы разработки проектов Тверского технологического центра AccentureВ любой сфере опыт работы рассматривается как определяющий критерий для оценки специалиста. Не является исключением и программирование, где принята  рыночным. Одним из вариантов является прохождение интервью на роль middle-разработчика на интересующих проектах. Если интервью успешно пройдено, то это первый сигнал к тому, что вы уже middle-разработчик.21\nОтвет эксперта\n2019-02-10T15:25:16+00:00\n\nРейтинг полезности ответа: 21\nПовысить\nПонизить\n\n\n\nСергей Толмачёв, Lead Scala Developer и куратор курса Scala Basic в Binary DistrictЯ вижу три возможные точки зрения: общепринятая, философско-справедливая и как на самом деле.1. Принятая, общая и неточная оценка имеет широкий кругозор. Это значит, что он не просто решает задачи в контексте кода одного проекта, но и знает, как и зачем он взаимодействует с другими сервисами, как поддерживает код, логирует события и мониторит в случае отказа, как разворачивается на сервера.Если он всё это знает, хоть, возможно, это и не его прямая обязанность, он может называть себя middle-разработчиком и просить повышения.3. В реальности же всё зависит от того, как разработчик продал себя при трудоустройстве. Если искали middle-разработчика, вы прошли отбор и прошли испытательный срок, будьте вы даже ещё студентом, то вы middle. Все оценки относительны, в каждой компании всё по-своему, требования и ожидания от сотрудников разной градации различаются. Опыт можно нарисовать, но всех действительно волнуют твои способности выполнять поставленную работу.25\nОтвет эксперта\n2019-02-10T15:25:16+00:00\n\nРейтинг полезности ответа: 25\nПовысить\nПонизитьДайте ещё мнениеВсё понятно, покажите выводыИтак, как понять, что вы уже выросли из junior’а?\nПереход из junior в middle , а к собственному развитию в качестве разработчика. А до middle/senior-специалистов пускай вас повышают сами работодатели.100500\nЛучший ответ\n2019-02-10T15:25:16+00:00\nTproger.ruНапоминаем, что вырасскажем, как это сделать. Для мотивации	https://tproger.ru/experts/junior-or-not/	107
985d5f50-386e-11e9-a5d4-28c2dd5a952f	Изоляция Рунета: зачем это нужно и как повлияет на обычных пользователей	Интернет	Дисклеймер Мнение редакции может отличаться от мнения автора статьи.В начале прошлого года был утверждён план мероприятий по направлению предоставлять в электронной форме в федеральный орган исполнительной власти информацию о сетевых адресах абонентов и их взаимодействии с другими абонентами, а также информацию о маршрутах сообщений электросвязи.Как видим, информация для передачи в органы федеральной власти очень интересная.Насколько высока вероятность воплощения этих планов в жизньСудя по стремительным темпам прохождения у законопроекта есть все шансы быть принятым в ближайшее время. Более того в бюджет уже начали закладывать затраты на реализацию данной законодательной инициативы.Что в итогеДаже у Правительства есть масса замечаний к законопроекту. Это говорит о том, что он ещё очень сырой и на первых порах его реализации исполнительная власть будет тренироваться, что несомненно может отразиться на удобстве рядовых пользователей, как это уже происходило с мессенджером Телеграм, при попытке блокировки которого был ограничен доступ к ряду добросовестных сервисов Сети. При этом полной изоляции от всемирной паутины ожидать скорее всего не стоит.Андрей Селивестров Интернет	https://tproger.ru/blogs/runet-isolation/	107
9878058a-386e-11e9-a5d4-28c2dd5a952f	Список инструментов разработчика JavaScript	JavaScript; Инструменты	В программной экосистеме JavaScript существует множество инструментов. В этой статье вам будут представлены наиболее удобные с точки зрения автора инструменты работы с JavaScript.Содержание статьи:Инструменты сборки и автоматизации;IDE и редакторы кода;Инструменты документирования кода;Инструменты тестирования;Инструменты отладки;Инструменты безопасности;Инструменты аналитики и оптимизации кода;Инструменты управления версиями;Инструменты управления пакетами и зависимостями.Инструменты сборки и автоматизацииWebpackЕвгений Туренко, кубанский переводчик JavaScript, Инструменты	https://tproger.ru/translations/javascript-tool-list/	107
