9a2f845c-386e-11e9-a5d4-28c2dd5a952f	Как отвечать работодателю на вопрос о зарплате  советы экспертов	Собеседование	Очень часто работодатель не озвучивает соискателю уровень заработной платы, а спрашивает у него желаемую цифру. Неопытные соискатели могут как занизить оценку своего труда, так и перегнуть палку. Мы спросили у экспертов, как кандидату наиболее точно оценить себя. Краткие выводы можно посмотреть внизу статьи.\n\n\n\nДарья Рудник, директор по персоналу компании  поговорить с их представителями. Ведь обратившегося к ним кандидата рекрутеры всегда стремятся продать подороже, чтобы получить комиссию с его будущей зарплаты. Но при этом они всё же не будут завышать вашу стоимость. И, скорее всего, расскажут, на какую сумму при текущей квалификации вы реально можете рассчитывать.\nРейтинг полезности ответа: 42\nПовысить\nПонизить\n\n\n\nЕкатерина Проклова, директор по персоналу компании  это воспользоваться специальными сервисами сайтов для поиска работы, которые не так давно появились и которые предлагают помочь оформить резюме и прицениться по уровню заработных плат.\nРейтинг полезности ответа: 42\nПовысить\nПонизить\n\n\n\nЕлена Федорова, HRM-директор DataArt, ВоронежРаботодателям действительно всегда сложно ответить на вопрос о заработной плате для той или иной позиции. Это связано с тем, что чаще всего разработчики владеют не только одним языком программирования или технологией повышать уровень владения английским языком и т. д.\nРейтинг полезности ответа: 42\nПовысить\nПонизить\n\n\n\nАлександра Балод, HR-директор 404 GroupЕсть только один способ не промахнуться с ожидаемой зарплатой на собеседовании  это часто ставит в тупик. Такая ситуация выглядит как игра, и победить в ней хотят обе стороны. Лучше, если вы чётко знаете сумму, ниже которой вы не готовы опускаться. Скажите об этом прямо. И не называйте суммы, которые на 70% выше того, что вы зарабатывали на прежней работе. Любая компания более-менее держит свои зарплаты на уровне рынка, и такой скачок её насторожит.\nРейтинг полезности ответа: 42\nПовысить\nПонизить\n\n\n\nЕкатерина Фирсова, HR-менеджер компании ParallelsКонечно, с ожиданиями по зарплате кандидатам надо определяться задолго до собеседования. Самый простой способ в этом случае  это обратиться за советом в хорошее кадровое агентство, так как они заинтересованы продать кандидата за максимально возможную сумму. Они смогут порекомендовать оптимальный уровень дохода и заодно сориентируют вас по вашей примерной рыночной стоимости.\nРейтинг полезности ответа: 42\nПовысить\nПонизитьИтак, как отвечать работодателю на вопрос о зарплате?Эксперты советуют использовать несколько простых пунктов:Если у вас есть знакомые в этой сфере, спросите у них про зарплату.Если их нет или они не хотят делиться информацией, то посмотрите на зарплаты вакансий со схожими требованиями. Не называйте суммы гораздо выше той, что вы зарабатывали на прежнем месте работы, если у вас оно было и вы устраиваетесь на примерно ту же должность.Наконец, с оценкой вашей стоимости могут помочь разные сервисы и кадровые агентства.Напоминаем, что вырасскажем, как это сделать. Собеседование	https://tproger.ru/experts/interview-expected-salary/	107
9a461dd4-386e-11e9-a5d4-28c2dd5a952f	Качественно новый уровень визуализации данных в Python	Data Science; Python; Визуализация	Рассказывает Уилл Кёрсен, data scientist в Cortex IntelНам сложно отказываться от дел, на которые мы уже потратили много времени. Поэтому мы остаёмся на нелюбимой работе, вкладываемся в проекты, которые точно не добавьте следующие импорты в блокнот Jupyter:# Стандартные импорты plotly\nimport plotly.plotly as py\nimport plotly.graph_obs as go\nfrom plotly.offline import iplot\nimport cufflinks\ncufflinks.go_offline()\n# Устанавливаем глобальную тему \ncf.set_config_file(world_readable=True, theme='pearl', offline=True)Гистограммы и бочки с усамиГрафики по одной переменной  надёжный выбор (хоть и не без изъянов) для отображения распределения. Давайте нарисуем интерактивную гистограмму количества лайков, используя статистику моих постов на Medium (df это обычный DataFrame):df['claps'].iplot(kind='hist', xTitle='claps',\n                  yTitle='count', title='Claps Distribution')Интерактивная гистограмма, созданная с помощью plotly + cufflinksЕсли вы работали с matplotlib, то вы заметили, что нам пришлось добавить всего одну букву (iplot() вместоplot()), чтобы получить гораздо более красивый и интерактивный график! Можно кликнуть на данные для получения подробностей, приблизить части графика и, как мы потом увидим, выбирать отдельные категории для просмотра.А вот так можно построить наложенные друг на друга гистограммы:df[['time_started', 'time_published']].iplot(\n    kind='hist',\n    histnorm='percent',\n    barmode='overlay',\n    xTitle='Time of Day',\n    yTitle='(%) of Articles',\n    title='Time Started and Time Published')Немного поколдовав с pandas, получим столбчатую диаграмму:# Создаём DataFrame с месячной частотой и строим график\ndf2 = df[['view','reads','published_date']].\\\n         set_index('published_date').\\\n         resample('M').mean()\ndf2.iplot(kind='bar', xTitle='Date', yTitle='Average',\n    title='Monthly Average Views and Reads')Как видите, мы можем совмещать возможности pandas и plotly + cufflinks. Для графика , который показывает количество лайкнувших каждый пост, мы сначала используем pivot(), а затем строим график:df.pivot(columns='publication', values='fans').iplot(\n        kind='box',\n        yTitle='fans',\n        title='Fans Distribution by Publication')Преимущества интерактивности заключаются в том, что мы можем исследовать данные и делать их выборки любым образом. Ящик с усами содержит много информации, большая часть которой пройдёт мимо нас, если мы не сможем видеть числа!Диаграмма рассеянияЭто, наверное, наиболее часто используемая диаграмма при анализе данных. Она позволяет увидеть изменение переменной с течением времени или отношение между двумя (или более) переменными.Временные рядыВ значительной части данных содержится информация о времени. К счастью, plotly + cufflinks были разработаны с расчётом на визуализацию временных рядов. Создадим DataFrame с моими статьями и посмотрим, как менялись тренды.# Создаём DataFrame со статьями Towards Data Science\ntds = df[df['publication'] == 'Towards Data Science'].\\\n         set_index('published_date')\n# Строим продолжительность чтения как временной ряд\ntds[['claps', 'fans', 'title']].iplot(\n    y='claps', mode='lines+markers', secondary_y = 'fans',\n    secondary_y_title='Fans', xTitle='Date', yTitle='Claps',\n    text='title', title='Fans and Claps over Time')Здесь мы в одну строку делаем сразу несколько разных вещей:Автоматически получаем красиво отформатированную ось X;Добавляем дополнительную ось Y, так как у переменных разные диапазоны;Добавляем заголовки статей, которые высвечиваются при наведении курсора.Для большей наглядности можно легко добавить текстовые аннотации:tds_monthly_totals.iplot(\n    mode='lines+markers+text',\n    text=text,\n    y='word_count',\n    opacity=0.8,\n    xTitle='Date',\n    yTitle='Word Count',\n    title='Total Word Count by Month')Диаграмма рассеяния с аннотациямиА вот так можно создать точечную диаграмму с двумя переменными, окрашенными согласно третьей категориальной переменной:df.iplot(\n    x='read_time',\n    y='read_ratio',\n    # Указываем категорию\n    categories='publication',\n    xTitle='Read Time',\n    yTitle='Reading Percent',\n    title='Reading Percent vs Read Ratio by Publication')\nСделаем график немного более сложным, используя логарифмическую ось (настраивается через аргумент layout, подробнее в документации) и установив размер пузырьков в соответствии с числовой переменной:tds.iplot(\n    x='word_count',\n    y='reads',\n    size='read_ratio',\n    text=text,\n    mode='markers',\n    # Log xaxis\n    layout=dict(\n        xaxis=dict(type='log', title='Word Count'),\n        yaxis=dict(title='Reads'),\n        title='Reads vs Log Word Count Sized by Read Ratio'))Если захотеть (подробности в блокноте), то можно уместить даже 4 переменные (не советую) на одном графике!Как и раньше, мы совмещаем возможности pandas и plotly + cufflinks для получения полезных графиков:df.pivot_table(\n    values='views', index='published_date',\n    columns='publication').cumsum().iplot(\n        mode='markers+lines',\n        size=8,\n        symbol=[1, 2, 3, 4, 5],\n        layout=dict(\n            xaxis=dict(title='Date'),\n            yaxis=dict(type='log', title='Total Views'),\n            title='Total Views over Time by Publication'))Загляните в блокнот или документацию, чтобы увидеть больше примеров добавленной функциональности. Мы можем добавить текстовые аннотации, контрольные линии и линии тренда отличный выбор, если нам нужно изучить отношения между многими переменными:import plotly.figure_factory as ff\nfigure = ff.create_scatterplotmatrix(\n    df[['claps', 'publication', 'views',      \n        'read_ratio','word_count']],\n    diag='histogram',\n    index='publication')Даже этот график полностью интерактивен, что позволяет нам исследовать данные.Корреляционная тепловая картаЧтобы отобразить взаимосвязи между числовыми переменными, сначала посчитаем коэффициенты корреляции, а затем создадим аннотированную тепловую карту:corrs = df.corr()\nfigure = ff.create_annotated_heatmap(\n    z=corrs.values,\n    x=list(corrs.columns),\n    y=list(corrs.index),\n    annotation_text=corrs.round(2).values,\n    showscale=True)Cufflinks также предлагает несколько тем, которые можно использовать для получения совершенно другого стиля, не прилагая усилий. Например, ниже можно увидеть графики с темами Никита Прияцелюк, последний центурион Data Science, Python, Визуализация	https://tproger.ru/translations/python-data-vizualization/	107
9a5bdf48-386e-11e9-a5d4-28c2dd5a952f	Подборка книг по компьютерным сетям	Сетевые протоколы	Компьютерные сети Оливьера Бонавентуры (Olivier Bonaventure) служит введением в тему компьютерных сетей. Первая часть книги содержит материал по основным концепциям, включая создание и настройку сети, адресацию, общий доступ к ресурсам и безопасность. Во второй части книги отдельно рассматриваются многие основные протоколы стека TCP/IP: HTTP, TLS, RPC, TCP, UDP, SCTP, IPv6, система доменных имён (DNS) и другое. В конце книги вы найдёте справочник по различным аббревиатурам, встречающимся в стандартах.А какими книгами по компьютерным сетям пользовались вы? Или какие книги вам рекомендовали ваши знакомые и преподаватели? Делитесь в комментариях.Алексей Грачев Сетевые протоколы	https://tproger.ru/books/computer-networks-books/	107
