9a866740-386e-11e9-a5d4-28c2dd5a952f	Функциональный CSS: упрощаем работу со стилями	CSS	Развитие браузеров ограничивало развитие CSS. И примерно с 2015 года (когда браузеры стали поддерживать flexbox) появилась возможность применить новые технологии в приложениях и на сайтах. На помощь пришли библиотеки функциональному CSSКакой смысл писать похожий CSS-код в разных проектах? Достаточно довериться людям, которые разбираются в дизайне и сэкономить своё время, используя функциональные CSS-библиотеки. Если вам уже знакомы основы CSS, то стоит присмотреться к новой волне изменений, ведь будущее не за горами.А если хотите их знать, то читайте также:Основы CSS: блочная модельКак работает CSS Flexbox: наглядное введение в систему компоновки элементов на веб-странице Перевод статьи Simplify Styling with Functional CSSАртем Гаврилов CSS	https://tproger.ru/translations/functional-css-usage/	107
9a9be1e2-386e-11e9-a5d4-28c2dd5a952f	Проект Эйлер: задачи, которые может решить только настоящий программист	Для мотивации	Разработчику практически всегда нужно решать разнообразные задачи и нет ничего лучше, чем практика. В Проекте Эйлер есть огромное количество различных заданий, которые помогут держать свой мозг в тонусе.Особенности платформы:Задачи можно решить на любом языке программирования, и они показывают, как хорошо вы знаете базовые операции выбранного языка.Вы научитесь писать надёжный, стандартный, классический код. Никаких библиотек, так что опираться на чужой код не получится.Вам придётся думать о том, как хранить данные в памяти и получать к ним доступ.Вам предстоит оптимизировать скорость обработки и хорошо подумать над используемыми алгоритмами.Однако сначала несколько слов о самом проекте.Проект ЭйлерЭто некоммерческая площадка с набором задач по математике и программированию, которая позволяет (и зачастую требует) расширить свои знания в различных областях и просто пораскинуть мозгами.Есть задачи разного уровня сложности, поэтому каждый, если постарается, найдёт ту, с которой сможет справиться. Сложность можно приблизительно оценить по количеству пользователей, решивших задачу. Не возбраняется пользоваться поисковиками, однако авторы предупреждают, что между поиском нужной информации и копипастой чужого решения есть тонкая грань, за которую не стоит заступать Никита Прияцелюк, последний центурион Для мотивации	https://tproger.ru/translations/project-euler-for-true-devs/	107
